import React from 'react'
import { styled } from '@mui/material/styles';
import {Box,List,ListItem,ListItemButton,ListItemText,Divider} from '@mui/material';

const Nav = () => {
  const NavBar = styled(Box)({
    height: `100vh`,
    backgroundColor: `#07553B`
  });
  const DividerColor = styled(Divider)({
    width: `80%`,
    backgroundColor: `#fff`
  });
  const TitleColor = styled(ListItemText)({
    color: `#fff`
  });

  return (
    <NavBar>
      <h1 style={{color:'#fff'}}>CALAC</h1>
      <DividerColor />
      <nav aria-label="main mailbox folders">
        <List>
          <ListItem disablePadding>
            <ListItemButton>
              <TitleColor primary="Inbox"/>
            </ListItemButton>
          </ListItem>
          <ListItem disablePadding>
            <ListItemButton>
              <TitleColor primary="Drafts" />
            </ListItemButton>
          </ListItem>
        </List>
      </nav>
      <DividerColor />
      <nav aria-label="secondary mailbox folders">
        <List>
          <ListItem disablePadding>
            <ListItemButton>
              <TitleColor primary="Trash" />
            </ListItemButton>
          </ListItem>
          <ListItem disablePadding>
            <ListItemButton component="a" href="#simple-list">
              <TitleColor primary="Spam" />
            </ListItemButton>
          </ListItem>
        </List>
      </nav>
    </NavBar>
  )
}

export default function StyledComponents() {
  return <Nav>StyledComponents</Nav>
}
